impl Solution {
    pub fn maximum_sum_of_heights(max_heights: Vec<i32>) -> i64 {
        let n = max_heights.len();
        let mut left_max = vec![0; n];
        let mut right_max = vec![0; n];
        let mut result = 0;

        // Compute maximum heights from the left to the right
        left_max[0] = max_heights[0];
        for i in 1..n {
            left_max[i] = left_max[i - 1].min(max_heights[i]);
        }

        // Compute maximum heights from the right to the left
        right_max[n - 1] = max_heights[n - 1];
        for i in (0..n - 1).rev() {
            right_max[i] = right_max[i + 1].min(max_heights[i]);
        }

        // Calculate the maximum possible sum of heights
        for i in 0..n {
            // The height at each position is the maximum possible height considering both sides
            let height = left_max[i].min(right_max[i]);
            result += height as i64;
        }

        result
    }
}
